import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLocationDot } from '@fortawesome/free-solid-svg-icons';

export default function Card(props) {
    return (
        <div className="card">
            <div className="left-col">
                <img src="https://images.unsplash.com/photo-1524413840807-0c3cb6fa808d?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1470&q=80" className="card__image"/>
            </div>
            <div className="right-col">
                <div className="location">
                    <FontAwesomeIcon icon={faLocationDot} className="fa-location-dot"/>
                    <p className="location__country">Japan</p>
                    <a href="#" className="location__view">View on Google Maps</a>
                </div>
                <h1 className="place__title">Akihabara</h1>
            </div>
        </div>
    )
}
